dataset:
  data_is_long_format: no
  custom_R_code: '
    data %>%
      mutate(
        `Collection Date` = lubridate::parse_date_time(`Collection Date`, orders = "mdy"),
        measurement_remarks = paste0("Collector: ", Collector),
        basis_of_record = ifelse(Cultivated %in% c("Z", "cultivated"), "captive_cultivated", "field"),
        basis_of_record = ifelse(is.na(basis_of_record), "field", basis_of_record),
        seed_weight = `Thousand Seed Weight`/1000,
        seed_weight = na_if(seed_weight, 0),
        gm_per_seed = 1/`Seed/gm`,
        gm_per_seed = ifelse(!is.na(seed_weight), NA, gm_per_seed)
      ) %>%
      filter(!is.na(`Scientific Name`))'
  collection_date: Collection Date
  taxon_name: Scientific Name
  location_name: location_name
  description: Seed trait data from the Tasmanian Seed Conservation Centre, including
    seed mass of collected seeds and data on germination trials.
  basis_of_record: basis_of_record
  life_stage: adult
  measurement_remarks: measurement_remarks
  sampling_strategy: The Tasmanian Seed Conservation Centre is a seed bank facility
    based at the Royal Tasmanian Botanical Gardens. It was opened in 2005 as part
    of international Millennium Seed Bank Project. The seed bank is focused on the
    native flora of Tasmania, with a particular emphasis on Tasmania's Rare and Threatened
    plants. A small number of introduced weeds and garden exotics are also held. The
    seed bank currently has one full time member of staff and a number of volunteers
    who assist in the processing and curation of the seed collections. Collecting
    priorities for the seed bank are informed and assisted by staff of the Biodiversity
    and Conservation Branch of Department of Primary Industries, Parks, Water and
    Environment. Collection verification is handled by the staff of the Tasmanian
    Herbarium.
  original_file: Data downloaded from https://seedbank.ala.org.au on 19 Feb 2025.
    Data downloaded by Order, for all vascular plants.
  notes: none
